var romanToInt = function (s) {
  let sum = 0;
  for (let i = 0; i < s.length; i++) {
    const curVal = strToVal[s[i]];
    const nextVal = s.length > i + 1 ? strToVal[s[i + 1]] : null;
    if (nextVal && curVal < nextVal) {
      sum += nextVal - curVal;
      i++;
    } else {
      sum += curVal;
    }
  }
  return sum;
};

