function rotateArrayBruteForce(array, rotations) {
    let counter = 0;

    while (counter < rotations) {
        for (let i = array.length - 1; i > 0; i--) {
            const temp = array[i];
            array[i] = array[i - 1];
            array[0] = temp;
        }

        counter++;
    }
    return {
        array,
        counter,
        rotations
    }
