const reverseInt = (n) => {
  let reversed = String(n).split("").reverse();
  let data;
  if (n > 0) {
    data = reversed.join("");
  } else {
    reversed = String(n).split("").reverse();
    reversed.splice(-1, 1);
    data = -Number(reversed.join(""));
  }
  return +data;
};

